static double SatelliteSensitivity = -116.4225;  //OK
static double TerrestrialSensitivity = -114.8623;  //OK
static double LinkClosureSNRThreshold = -4.75;  //OK

static double
GetSatelliteSensitivity(int scs)
{
	switch (scs)
	{
	case 15:
		return SatelliteSensitivity;//[0];
		break;
/*	case 30:
		return SatelliteSensitivity[1];
		break;
	case 60:
		return SatelliteSensitivity[2];
		break;*/
	default:
		cout << "ERROR: Used SCS not supported" << endl;
		exit(1);
		break;
	}
};

static double
GetTerrestrialSensitivity(int scs)
{
	switch (scs)
	{
	case 15:
		return TerrestrialSensitivity;//[0];
		break;
/*	case 30:
		return TerrestrialSensitivity[1];
		break;
	case 60:
		return TerrestrialSensitivity[2];
		break;*/
	default:
		cout << "ERROR: Used SCS not supported" << endl;
		exit(1);
		break;
	}
};

static double
GetSNRThreshold()
{
	return LinkClosureSNRThreshold;
};

