// Given SINR and MCS, return the BLER
static double
GetBLER_SAT5G(double SINR, int MCS)  //OK
{
	int index = -1;
	double BLER = 0.0;
	int MCS_ = MCS;
	double R = 0.0;

	if (SINR <= SINR4BLER_5G_SAT[0])
	{
		BLER = 1.0;
	}
	else if (SINR >= SINR4BLER_5G_SAT[120])
	{
		BLER = 0.0;
	}
	else
	{
		for (int i = 0; i < 120; i++)
		{
			if (SINR >= SINR4BLER_5G_SAT[i] && SINR < SINR4BLER_5G_SAT[i + 1])
			{
				index = i;
			}
		}
	}

	if (index != -1)
	{
		R = (SINR - SINR4BLER_5G_SAT[index]) / (SINR4BLER_5G_SAT[index + 1] - SINR4BLER_5G_SAT[index]);
		BLER = BLER_5G_SAT[MCS_][index] + R * (BLER_5G_SAT[MCS_][index + 1] - BLER_5G_SAT[MCS_][index]);
	}
	return BLER;
}

